import React from 'react';

class Account extends React.Component{
    render()
    {
        return(
            <div>
                <p> 
                    page for any signed in user to see
                    Your name is {this.props.userName}
                    <div/>
                    Your email is {this.props.userEmail}
                </p>
            </div>
        );
    }
}

export default Account;
